  return (
    <div className="dashboard-container">
      <aside className="sidebar">
        <h2 style={{ userSelect: 'none', outline: 'none' }}>√ìrbita</h2>
        <nav>
          <ul>
            <li><Link to="/usuarios">üë• Usu√°rios</Link></li>
            <li><Link to="/configuracoes-empresa">‚öôÔ∏è Configura√ß√µes da Empresa</Link></li>
          </ul>
        </nav>
      </aside>

      <main className="dashboard-content">
